import React from 'react';

import {connect} from 'react-redux';

const ChangeUsername = (props) => {
    return (
        <div className='container-fluid'>
            <div className='.col-md-6 changeUsername'>
                Username: <br />
                <input type='text' onChange={props.onUsernameChange} placeholder='Enter username here'/>
                <button onClick={props.onSubmitClick}>Submit</button>
            </div>
        </div>
    )
}

const mapDispatchToProps = (dispatch) => {
    return {
        onUsernameChange: (event) => dispatch({ type: 'CHANGE_USERNAME', value: event.target.value }),
        onSubmitClick: () => dispatch({type: 'SAVE_CHANGES'})
    }
}

export default connect(null, mapDispatchToProps)(ChangeUsername);
